import LogIn from './components/LogIn';

const App = () => {
	return (
		<Router>
			<Home />
			<LogIn/>
			{/* <Route exact path='/'><Result result={result} /></Route> */}
			{/* <Route path='/result'><Result result={result} /></Route> */}

		</Router>
	);
};

export default App;
